from Customer import Customer;

# Criando classe market
class Market:
    # Construtor
    def __init__(self, counterCount: int):
        self.__counter: list[Customer | None] = [None for _ in range(counterCount)];
        self.__queue: list[Customer] = [];
    # Fim construtor

    # Método str
    def __str__(self):
        listaCounter: list[Customer | str] = [];

        for i in self.getCounter():
            listaCounter.append(i if i != None else '-----');

        retorno = "Caixa: ";
        for i in listaCounter:
            retorno += i

        print(listaCounter);
        return 'Teste';


    # Fim método str

    # Método de acesso
    def getCounter(self) -> list[Customer | None]:
        return self.__counter;

    def getQueue(self) -> list[Customer]:
        return self.__queue;
    # Fim método de acesso
# Fim market


m = Market(counterCount = 2);

print(m);
print(m.getCounter());
print(m.getQueue());
